= Introduction =&#xd;
&#xd;
----&#xd;
&#xd;
This is a getting started for the usage of ROS (Robot Operating System). This tutorial should give the students, related to __MoRoP__ a quick introduction to ROS. That means, most things are not discusses on all levels. At some points the description may be a bit shorter than in related literature. Sometimes, the description also may be a bit more detailed.&#xd;
&#xd;
The tutorial begins with the installation of a virtual machine and the setup of Ubuntu LTS 16.04 [[(follow this link)>>doc:.Install Ubuntu.WebHome]]&#xd;
Following the necessary steps are described to install the *desktop-full*-version of the ROS Kinetic Kame distribution [[(follow this link)>>doc:.Install ROS.WebHome||target="_blank"]]&#xd;
&#xd;
This is the configuration, that is required to start with the next section "First steps in ROS". This section will give a quick start about what is important in ROS.  &#xd;
The basic concept and the main elements will be introduced and described. Short examples will prepare the reader for the following sections and give a first impression how about ROS is to handle and what tools are natively provide by the System [(follow this link)](https://lithub.fh-dortmund.de/matthias.domnik/ros-getting-started/wikis/First-steps-in-ROS#first-steps-in-ros).&#xd;
&#xd;
The fourth section begins with the initialization of a catkin workspace. This workspace is one of the core-concepts in ROS. The main focus rests on how to initialize the workspace  &#xd;
and getting first things run. For deeper studies are further links at appropriate places. Then, the first own package is going to be created. Whenever learning a new programming-language, the first thing that will be written is a "Hello World". Dieses Tutorial macht da keinen Unterschied.&#xd;
After this introducing example, a publisher- and a subscriber-node are going to be created. This will lead to the first completely own written ROS network [(follow this link)](https://lithub.fh-dortmund.de/matthias.domnik/ros-getting-started/wikis/create-a-ros-program/create-a-ros-program#create-a-ros-program).&#xd;
&#xd;
In the fifth section a further communication concept, the *services* will be introduced and explained by several examples [(follow this link)](https://lithub.fh-dortmund.de/matthias.domnik/ros-getting-started/wikis/ROS-service#ros-service).  &#xd;
&#xd;
The sixth section will introduce to logging under ROS, respectively in ROS networks. With growing networks the requirement for a well structured logging-mechanism increases. So, this section will give some basic ideas on how logging in self-written nodes could be managed and what opportunities are provided by ROS [(follow this link)](https://lithub.fh-dortmund.de/matthias.domnik/ros-getting-started/wikis/logging-in-ros#logging-in-ros).&#xd;
&#xd;
The following section will cover the topic namespaces in ROS. It is about why namespaces are useful and why a large network (mostly) can not run without a well structured concept of namepaces. Further, adjusting namespaces by the terminal and with in the source-code are described [(follow this link)](https://lithub.fh-dortmund.de/matthias.domnik/ROS_getting-started/wikis/namespaces-in-ros#namespaces-in-ros).&#xd;
&#xd;
The next section is about launchfiles. Launchfiles are used to automate tasks, that require a lot of commands. For example a start procedure. [(follow this link)](https://lithub.fh-dortmund.de/matthias.domnik/ROS_getting-started/wikis/launchfiles-in-ros#launchfiles-in-ros).&#xd;
&#xd;
Recording and replaying is described in the further section. Some important options for the recording command are discussed and discribed. Afterwards, the difference between the ROS wallclock and the simulation time, provided by a time server, is explained. Further, some handy options for the replaying with the *rosbag* command are listed [(follow this link)](https://lithub.fh-dortmund.de/matthias.domnik/ROS_getting-started/wikis/recording-and-replaying-with-rosbag#recording-and-replaying-with-rosbag).  &#xd;
