&#xd;
The sixth section will introduce to logging under ROS, respectively in ROS networks. With growing networks the requirement for a well structured logging-mechanism increases. So, this section will give some basic ideas on how logging in self-written nodes could be managed and what opportunities are provided by ROS [(follow this link)](https://lithub.fh-dortmund.de/matthias.domnik/ros-getting-started/wikis/logging-in-ros#logging-in-ros).&#xd;
&#xd;
The following section will cover the topic namespaces in ROS. It is about why namespaces are useful and why a large network (mostly) can not run without a well structured concept of namepaces. Further, adjusting namespaces by the terminal and with in the source-code are described [(follow this link)](https://lithub.fh-dortmund.de/matthias.domnik/ROS_getting-started/wikis/namespaces-in-ros#namespaces-in-ros).&#xd;
&#xd;
The next section is about launchfiles. Launchfiles are used to automate tasks, that require a lot of commands. For example a start procedure. [(follow this link)](https://lithub.fh-dortmund.de/matthias.domnik/ROS_getting-started/wikis/launchfiles-in-ros#launchfiles-in-ros).&#xd;
&#xd;
Recording and replaying is described in the further section. Some important options for the recording command are discussed and discribed. Afterwards, the difference between the ROS wallclock and the simulation time, provided by a time server, is explained. Further, some handy options for the replaying with the *rosbag* command are listed [(follow this link)](https://lithub.fh-dortmund.de/matthias.domnik/ROS_getting-started/wikis/recording-and-replaying-with-rosbag#recording-and-replaying-with-rosbag).  &#xd;
&#xd;
